May 2023 ~ Dominica did not disappoint! (Not to be confused with the Dominican Republic) “The Nature Island” was truly just that — a magical place full of breathtaking black sand beaches, red rocks, cliffs, a boiling lake, multiple 250-300 ft. tall waterfalls, 365 rivers, countless hiking trails, stunning turquoise water, a lush tropical rainforest, world class reefs to snorkel and more! Pirates of the Caribbean even filmed two movies here — such an incredible island! 🇩🇲🏝️ 

